import { Link } from "react-router-dom";

const PRODUCTS = [
        { id: 'p1', title: '제품1'},
        { id: 'p2', title: '제품2'},
        { id: 'p3', title: '제품3'},
]


function ProductsPage(){
    return (
    <>
    <h1>여기는 제품들이 보여지는 페이지입니다.</h1>
        <ul>
  
            {PRODUCTS.map((prod)=>(
                <li key={prod.id}>
                    <Link to={`/product/${prod.id}`}>{prod.title}</Link>
                </li>
        ))}
        </ul>
    <p>
     메인 페이지로<Link to="/">이동</Link>
    </p>
    </>
    );
}

export default ProductsPage;
